	(3, 2, 1, 'INFORME MÉDICO', 'Se trata de paciente FEMENINA de 50 años de edad, quien consulta por\r\npresentar dolor intenso en rodilla derecha posterior a HECHO VIAL, el 19.10.2021,\r\ncaída en vehículo en movimiento (Moto), doblando la rodilla, e impacto contra el\r\npavimento. Presentado importante dolor y edema de la misma. Al examen físico\r\nactual: persiste marcha claudicante, con escaso edema de rodilla y marcha asistida\r\ncon baston, a la digitopresión dolor en puntos meniscales mediales, persiste\r\nimposibilidad para la flexión completa de rodilla derecha, Apley positivo derecho,\r\nbostezo medial aun doloroso. Raspado rotuliano doloroso. Se solicita estudio rx que\r\nrevela fractura en vías de consolidación. condromalacia rotuliana grado I. Se cumple\r\nviscosuplementación. Se indica inmovilización. Solicito RMN de fecha 11 de Enero de 2022, que revela: DERRAME ARTICULAR, CONDROMALACIA ROTULIANA GRADO I, FRACTURA CON LESIÓN OSTEOCONDRAL EN MESETA TIBIAL EXTERNA, ASPECTO\r\nPOSTERIOR, RUPTURA EN CUERPO Y CUERNO POSTERIOR DE MENISCO EXTERNO:\r\nCon evoloción tótpida, dada por consolidación viciosa (Hundimiento) y dolor intenso al levantarse y al caminar. Amerita cirugía artroscopica. Por lo que se plantea incapacidad\r\nDx:\r\n1.- ESGUINCE DE RODILLA DERECHA\r\n2.- FRACTURA CON LESION OSTEOCONDRAL EN MESETA TIBIAL EXTERNA\r\n3.- RUPTURA DEL CUERPO Y CUERNO POSTERIOR DE MENISCO EXTERNO\r\n4.- DERRAME ARTICULAR', '2022-04-05 00:00:00', NULL, NULL),
	(4, 30, 1, 'INFORME MÉDICO', 'Se trata de paciente femenina de 56 años de edad, quien posterior a resbalón en el baño, presenta politraumatismos generalizados, traumatismo en región parietal izquierda, dolor en región cervical y dolor intenso en cara medial de pie izquierdo, con edema y crepitación. al examen físico se evidencia paciente en malas condiciones generales fascie álgida, neurológicamente compensada, cuello doloroso a la movilización con maniobra de spurling positiva, en pie izquierdo, aumento de volumen, hematoma en cara lateral y medial del pie, dolor a la movilización y crepitación. se solicita estudios radiológicos que revelan solución de continuidad (fractura) en tercio medio con proximal de v metatarsiano. se realizan maniobras de tracción y contra tracción y se coloca bota de yeso.\r\ndx\r\nTEC CERRADO\r\nCERVICOBRAQUIALGIA AGUDA POSTRAUMÁTICA\r\nESGUINCE GRADO II DE TOBILLO IZQUIERDO\r\nFRACTURA EN TERCIO MEDIO CON PROXIMAL DE V METATARSIANO IZQUIERDO\r\n', '2022-11-05 00:00:00', NULL, NULL),
	(5, 35, 1, 'INFORME MÉDICO', '      Se trata de paciente femenina de 55 añosde edad quien cursa con dolor cronicode region lumbar, que se irradia a region gluteobilateral y pierna derecha, sin antecedentes traumaticos,intenso constante e incapacitante,  conmitentemente, mareos intensos y frecuentes, Al examen fisico actual se evidencia paciente con fascie  algido, afebril que se marea al levantarse o moverse en la cama con dolor intenso a la digito presion en region lumbar baja, lasaje posotiva a los 35o, que se extiende a fosa poplitea y cara anterior al pie, sin parestesia. Puntos ureterales negativos, puño percusion negativa, hay limitacion y dolor a la bipedestaciony deambulacion. Se indica tratamiento medico y reposo por 72 horas ...', '2022-06-16 00:00:00', NULL, NULL),
	(6, 5, 6, 'INFORME MÉDICO', 'Se trata de paciente MASCULINO de 48 años de edad, quien consulta por presentar dolor intenso en rodilla izquierda posterior a caída en área de trabajo, el 21.01.2022, doblando la rodilla, presentado importante dolor y edema de la misma. Al examen físico actual: persiste marcha claudicante, con muy discreto edema de rodilla izquierda, persiste dolor a la digitopresión en puntos meniscales  mediales, con imposibilidad para la flexión completa de rodilla izquierda.  Apley positivo izquierdo, bostezo medial aun doloroso. Raspado rotuliano doloroso. Se ajusta  tratamiento médico ambulatorio. Cumplo Viscosuplementación. \r\nDx: \r\n1.	ESGUINCE DE RODILLA IZQUIERDA\r\n2.	ELONGACIÓN (RUPTURA) DE LIGAMENTO COLATERAL MEDIAL\r\n3.	CONDROMALACIA ROTULIANA BILATERAL \r\n4.	DESGARRO DE LIGAMENTO CRUZADO ANTERIOR.\r\n5.	DERRAME ARTICULAR\r\n\r\n', '2022-04-05 00:00:00', NULL, NULL),
	(7, 34, 1, 'INFORME MÉDICO', 'SE TRATA DE PACIENTE MASCULINO DE 25 AÑOS DE EDAD, QUIEN PRESENTA FRACTURA WEBER TIPO C DE TOBILLO IZQUIERDO, POSTERIOR A EVERSION FORZADA DEL PIE, EL 07.04.22, CONSOLIDADA, SINDROME COMPARTAMENTAL RESUELTO Y ACTUALMENTE CON SINDROME MIOSIMPATICO REFLEJO (SINDROME DE SUDECK), POR LO QUE AMERITA TRATAMIENTO MEDICO, FISIATRICO Y REPOSO.\r\nDX:\r\nFRACTURA WEBER TIPO C DE TOBILLO IZQUIERDO CONDOLIDADA\r\nESGUINCE GRADO II DE TOBILLO IZQUIERDO \r\nSINDROME COMPARTAMENTAL RESUELTO\r\nSINDROME MIOSIMPATICO REFLEJO DE PIE IZQUIERDO', '2022-11-05 00:00:00', NULL, NULL),
	(8, 25, 2, 'INFORME MÉDICO', 'Se trata de paciente femenina, quien posterior a herida en cara ventral de mano derecha (Palma), presenta sección de tendones flexores superficial y profundo de dedo índice derecho y superficial de dedo medio derecho, en zona 2-3 y sección de rama sensitiva de mediano derecho. Que ameritó tratamiento quirúrgico, exploración quirúrgica, control de hemorragia, hemostasia, tendinorafia según técnica de Kessler modificada de los tres tendones y neurorafia de rama sensitiva del mediano. Se comprueba movilidad. Se coloca inmovilización. Evolución satisfactoria, por lo que se decide su egreso..\r\nDx:	\r\nHERIDA INCISA COMPLICADA EN PALMA DE MANO DERECHA\r\nSECCIÓN DE TENDÓN FLEXOR SUPERFICIAL DE DEDO ÍNDICE Y MEDIO\r\nSECCIÓN DE TENDÓN PROFUNDO DE DEDO ÍNDICE \r\nSECCIÓN DE RAMA SENSITIVA DE NERVIO MEDIANO.\r\n', '2022-05-19 00:00:00', NULL, NULL),
	(9, 44, 1, 'INFORME MÉDICO', 'Se trata de paciente masculino quien cursa con dolor edema y limitación funcional de rodilla izquierda, sin antecedente traumático, al examen físico se encuentra paciente, con marcha claudicante, edema de rodilla izquierda, con signo del tempano positivo, raspado rotuliano positivo, flexión dolorosa, apley positivo medial. Se cumple viscosuplementación de rodilla izquierda. Concomitantemente lumbociatalgia, con lasègue positivo. Solicito estudios radiológicos. Se indica tratamiento médico.\r\nDx.\r\nCONDROMALACIA ROTULIANA BILATERAL A PREDOMINIO IZQUIERDO\r\nHIDRARTROS INCIPIENTE\r\nGENUVARO ARTROSICO\r\nLUMBOCIATALGIA DE EAP.  \r\n', '2022-05-25 00:00:00', NULL, NULL),
	(10, 20, 2, 'INFORME MÉDICO', 'Se trata de paciente masculino de 63 años de edad, quien cursa con dolor intenso en región lumbar, que se irradia a ambos miembros inferiores, cara anterior de ambos muslos a predominio izquierdo y región glútea derecha. Con evolución satisfactoria al tratamiento en sus inicios, pero con recidiva intensa en losúltimos dias, asociados a actividad intensa.  Al examen físico actual: Paciente que entra caminando derecho, columna que duele al movimiento de extensión, digitopresion dolororosa de L3L4, L4L5 y L5S1. Pede caminar por sus propios medios. Lasègue positivo a los 60º. ROT conservados. Persisten parestesias en muslo izquierdo ¾ en relación a muslo derecho, tipo hipersensibilidad y parestesias dadas por disminución de la sensibilidad en pie izquierdo. En vista de la persistencia del dolor se realiza 2º bloqueo radicular lumbar, Y se ajusta tratamiento médico prolongado con pregabalina, analgésicos, relajantes musculares, crema analgésica, protector gástrico. RMN de columna lumbo sacra, confirma diagnósticos.   \r\nDx:\r\n1.- LUMBOCIATALGIA SEVERA \r\n2.- SINDROME DE COMPRESIÓN RADICULAR LUMBAR L3L4, L4L5, L5S1 \r\n3.- ESPONDILODISCOPATIAMULTISEGMENTARIA,\r\n4.- ABOMBAMIENTO DISCAL L4-LS Y L5-SI QUE SE ASOCIA A HIPERTROFIA FACETARIA Y CONDICIONAN\r\n5.- COMPRONISO FORAMINAL BILATERAL L4-LS Y DERECHO L5-51\r\n\r\n\r\n\r\n', '2022-05-25 00:00:00', NULL, NULL),
	(11, 34, 2, 'INFORME MÉDICO', 'SE TRATA DE PACIENTE MASCULINO DE 25 AÑOS DE EDAD, QUIEN CURSA CON FRACTURA WEBER TIPO C DE TOBILLO IZQUIERDO CONSOLIDADA, SINDROME COMPARTAMENTAL RESUELTO, POSTERIOR A EVERSION FORZADA DEL PIE, EL 07.04.22, Y ACTUALMENTE CURSA CON SINDROME MIOSIMPATICO REFLEJO (SINDROME DE SUDECK), QUE HA MEJORADO UN 60%, POR LO QUE AMERITA CONTINUAR CON TRATAMIENTO MEDICO, FISIATRICO Y REPOSO.\r\nDX:\r\nFRACTURA WEBER TIPO C DE TOBILLO IZQUIERDO CONDOLIDADA\r\nESGUINCE GRADO II DE TOBILLO IZQUIERDO \r\nSINDROME COMPARTAMENTAL RESUELTO\r\nSINDROME MIOSIMPATICO REFLEJO DE PIE IZQUIERDO', '2022-05-25 00:00:00', NULL, NULL),
	(12, 50, 1, 'INFORME MÉDICO', '.', '2022-01-06 00:00:00', NULL, NULL),
	(13, 49, 1, 'INFORME MÉDICO', 'Se trata de paciente femenina de 61 años de edad, quien consulta por presentar dolor intenso en rodilla izquierda posterior a caída en área de trabajo, el 31.06.2022, doblando la rodilla, presentado importante dolor y edema de la misma. Al examen físico: se evidencia paciente con fascie álgida, afebril, con marcha claudicante, deformidad y edema de rodilla izquierda, con claudicación,  y marcha asistida a la digitopresión dolor en puntos meniscales  mediales, con imposibilidad para la flexión completa de rodilla izquierda, Apley positivo izquierdo, bostezo medial dolorosa. Raspado rotuliano doloroso. Signo del tempano positivo. Se solicita Rx, que revela rarefacción en área medial de rodilla izquierda, con bostezo lateral. Se realiza artrocentesis obteniendo 40 cc de liquido serohematico. Se coloca vendaje compresivo y se programa para viscosuplementación. Solicito examenes de laboratorio.      \r\nDx: \r\n1.	ESGUINCE DE RODILLA IZQUIERDA\r\n2.	ELONGACIÓN (RUPTURA) DE LIGAMENTO COLATERAL MEDIAL\r\n3. HIDRARTROS DE RODILLA IZQUIERDA.	\r\n4. CONDROMALACIA ROTULIANA BILATERAL \r\n4.	DESGARRO DE LIGAMENTO CRUZADO ANTERIOR.\r\n\r\n', '2022-01-06 00:00:00', NULL, NULL),
	(14, 55, 1, 'INFORME MÉDICO', 'Femenina, con cervicobraquialgia, lumbociatalgia severa,\r\ncontractura paravertebral toracolumbar derecha, neuritis intercostal\r\nderecha, canal estrecho foraminal L5S1 bilateral, radiculopatia L5\r\nderecha, estrechez de receso S1 izquierdo, espondiloartrosis lumbar,\r\nescoliosis del adulto, con sintomatología compresiva radicular severa,\r\nque no ha mejorado a pesar de tratamieto medico.  Se mantiene reposo y tratamiento fisiátrico..', '2023-01-18 00:00:00', NULL, NULL),
	(15, 34, 3, 'INFORME MÉDICO', 'SE TRATA DE PACIENTE MASCULINO DE 25 AÑOS DE EDAD, QUIEN CURSA CON FRACTURA WEBER TIPO C DE TOBILLO IZQUIERDO CONSOLIDADA, SINDROME COMPARTAMENTAL RESUELTO, POSTERIOR A EVERSION FORZADA DEL PIE, EL 07.04.22, Y ACTUALMENTE CURSA CON SINDROME MIOSIMPATICO REFLEJO (SINDROME DE SUDECK), EN RESOLUCIÓN. POR LO QUE SE AUTORIZA A REINCORPORAR SUS LABORES HABITUALES. SE MANTIENE TRATAMIENTO FISIATRICO\r\nDX:\r\nFRACTURA WEBER TIPO C DE TOBILLO IZQUIERDO CONDOLIDADA\r\nESGUINCE GRADO II DE TOBILLO IZQUIERDO \r\nSINDROME COMPARTAMENTAL RESUELTO\r\nSINDROME MIOSIMPATICO REFLEJO DE PIE IZQUIERDO (EN RESOLUCIÓN)', '2022-08-06 00:00:00', NULL, NULL),
	(16, 44, 2, 'INFORME MÉDICO', 'Se trata de paciente masculino quien cursa con dolor edema y limitación funcional de rodilla izquierda, sin antecedente traumático, al examen físico se encuentra paciente, con marcha mormal, discreto edema de rodilla izquierda, con signo del tempano negativo, raspado rotuliano positivo, flexión dolorosa, apley positivo medial. Se cumple viscosuplementación de rodilla izquierda. Concomitantemente lumbociatalgia, con lasègue positivo. Trae estudios radiológicos, que revela lateralizacion de rotula izquierda. Se ajusta tratamiento médico. Cumplo viscosuplementación.\r\nDx.\r\nCONDROMALACIA ROTULIANA BILATERAL A PREDOMINIO IZQUIERDO\r\nHIDRARTROSIS RESUELTA\r\nGENUVARO ARTROSICO\r\nLUMBOCIATALGIA DE EAP. ', '2022-06-15 00:00:00', NULL, NULL),
	(17, 75, 1, 'INFORME MÉDICO', '.', '2022-06-15 00:00:00', NULL, NULL),
	(18, 82, 1, 'INFORME MÉDICO', 'Se trata de paciente masculino, portador de HEMOFILIA, quien consulta por presentar dolor en hombro izquierdo, de larga data, al examen fisico, imposibilidad, para la abducción rotación interna y externa y extensión. Se solicita estudio radiológico, que revela malformación de la cabeza humeral, dada porachatamiento con perdida de la congruencia articular. \r\nSe indica tratamiento medico. \r\nDx.\r\nARTROSIS HEMOFILICA DE HOMBRO IZQUIERDO. ', '2022-06-22 00:00:00', NULL, NULL),
	(19, 77, 1, 'INFORME MÉDICO', 'Se trata de paciente masculino, quien consulta por presentar dolor intenso en región lumbar, que se irradia a región glútea bilateral y pierna derecha, posterior a levantar peso, dolor que es constante e incapacitante y que no alivia con analgesicos. Concomitantemente, mareos intensos y frecuentes. Al examen físico actual: se evidencia paciente con fascie álgida, afebril, que se marea al levantarse o moverse en la cama, con dolor intenso a la digitopresión en región lumbar baja, Lasègue positivo a los 35 °, que se extiende a fosa poplítea y cara anterior del pie, sin parestesias. O`Connel positivo, Puntos ureterales negativos, puño percusión negativa. Hay limitación y dolor a la bipedestación y deambulación. Reflejos osteotendinosos alterado derecho, sensibilidad conservada pero refiere hormigueo y calmbres en pantorillas. Se cumple bloqueo facetario solicito RMN de columna lumbosacra.  \r\n\r\nDx: \r\n1.	LUMBOCIATALGIA SEVERA \r\n2.	SINDROME DE COMPRESIÓN RADICULAR LUMBOSACRA POST TRAUMÁTICO\r\n3.	VERTIGO DE EAP\r\n4.	SINDROME FORAMINAL L4L5 y L5S1.\r\n', '2022-06-16 00:00:00', NULL, NULL),
	(20, 77, 2, 'INFORME MÉDICO', 'Se trata de masculino de 36 años de edad quien se encuentra hospitalizado por síndrome de compresión radicular L4L5 y L5S1, agudo postraumático. Que no ha mejorado a pesar del tratamiento médico. Clínicamente continúa presentando parestesias en miembro inferior derecho, dadas por calambre y hormigueo, dolor persistente que ha mejorado un 30 % pero que se exacerba con la deambulación. Rasgue positivo. Estudios de RMN revelan acentuación de la lordosis fisiológica con anterolistesis L5S1 grado I, abombamiento discal L4L5 y protrusión concéntrica L5S1 que condiciona compromiso foraminal bilateral, mayor en L5S1 por hipertrofia de facetas articulares. Se sugiere mantener hospitalización y se cumple bloqueo radicular\r\nDx: \r\n1.	LUMBOCIATALGIA SEVERA POSTRAUMATICA \r\n2.	SINDROME FORAMINAL L4L5 y L5S1.\r\n3. SINDROME FACETARIO L5S1\r\n4. ABOMBAMIENTO DISCAL L4L5 \r\n5. PROTRUSIÓN DISCAL CENTRAL L5S1', '2022-06-18 00:00:00', NULL, NULL),
	(21, 44, 3, 'INFORME MÉDICO', 'Se trata de paciente masculino quien cursa con dolor edema y limitación funcional de rodilla izquierda, sin antecedente traumático, al examen físico actual, se encuentra paciente, con marcha normal, sin edema de rodilla izquierda, con signo del tempano negativo, raspado rotuliano positivo, flexión dolorosa, apley positivo medial. Se cumple viscosuplementación de rodilla izquierda. Concomitantemente lumbociatalgia, con lasègue negativo. Se ajusta tratamiento médico.\r\nDx.\r\nCONDROMALACIA ROTULIANA BILATERAL A PREDOMINIO IZQUIERDO\r\nHIDRARTROSIS RESUELTA\r\nGENUVARO ARTROSICO\r\nLUMBOCIATALGIA DE EAP. EN RESOLUCIÓN ', '2022-07-13 00:00:00', NULL, NULL),
	(22, 34, 4, 'INFORME MÉDICO', 'SE TRATA DE PACIENTE MASCULINO DE 25 AÑOS DE EDAD, QUIEN CURSA CON FRACTURA WEBER TIPO C DE TOBILLO IZQUIERDO CONSOLIDADA, SINDROME COMPARTAMENTAL RESUELTO, POSTERIOR A EVERSION FORZADA DEL PIE, EL 07.04.22, Y SINDROME MIOSIMPATICO REFLEJO (SINDROME DE SUDECK), EN RESOLUCIÓN. POR LO QUE MANTIENE EN SUS LABORES HABITUALES. SE MANTIENE TRATAMIENTO FISIATRICO\r\nDX:\r\nFRACTURA WEBER TIPO C DE TOBILLO IZQUIERDO CONDOLIDADA\r\nESGUINCE GRADO II DE TOBILLO IZQUIERDO \r\nSINDROME COMPARTAMENTAL RESUELTO\r\nSINDROME MIOSIMPATICO REFLEJO DE PIE IZQUIERDO (EN RESOLUCIÓN)', '2022-07-13 00:00:00', NULL, NULL),
	(23, 110, 1, 'INFORME MÉDICO', 'Se trata de paciente femenina, quien posterior a caída de su propia altura, presenta fractura de tobillo weber C, que ameritó tratamiento quirúrgico el 30.05.2022, reducción cruenta y osteosíntesis, con evolución tórpida, dada por signos de flogosis, calor, rubor y secreción con zonas de defecto cutáneo, y tejido necrótico. Se realiza limpieza, exhaustiva, con estimulación de bordes y exéresis de tejido necrosado. Vendaje compresivo. Solicito estudios Radiológico.  ', '2022-07-14 00:00:00', NULL, NULL),
	(24, 127, 2, 'INFORME MÉDICO', 'Se trata de paciente masculino, quien presenta dolor de fuerte intensidad, en region lumbar, que se irradia a región sacra y lumbar, con dificultad para la deambulación posterior a levantar peso. Al examen físico, paciente en malas condiciones generales, con fascie álgida y marcha claudicante, con Lasègue positivo, disminución de la sensibilidad en cara lateral de pierna derecha Disminución de la fuerza en hallux derecho. Dolor a la flexión, extensión y rotación derecha de la columna. O´Connel negativo. En vista de condiciones generales, se decide hospitalización, se cumple bloqueo radicular derecho de L5S1 y se solicita. RNM de columna lumbo sacra.\r\nDx.\r\n1.- SINDROME DE COMPRESION RADICULAR L5S1 POS TRAUMÁTICO\r\n2.- LUMBOCIATALGIA POSTRAUMÁTICA DERECHA CON DEFICIT NEUROLÓGICO . ', '2022-07-28 00:00:00', NULL, NULL),
	(25, 110, 4, 'INFORME MÉDICO', 'Se trata de paciente femenina, quien posterior a caída de su propia altura, presenta fractura de tobillo weber C, que ameritó tratamiento quirúrgico el 30.05.2022, reducción cruenta y osteosíntesis, con evolución tórpida, dada por signos de flogosis, calor, rubor y secreción con zonas de defecto cutáneo, y tejido necrótico. Se realiza limpieza, exhaustiva, con estimulación de bordes y exéresis de tejido necrosado y se realiza rafia de herida, se coloca vendaje compresivo.\r\nDx\r\nFRACTURA DE TOBILLO WEBER TIPO C EN VIAS DE CONSOLIDACION\r\nHERIDA CONTAMINADA RESUELTA\r\nDEHISCENCIA DE SUTURA\r\nRAFIA DE HERIDA.  ', '2022-10-08 00:00:00', NULL, NULL),
	(26, 137, 1, 'INFORME MÉDICO', 'Se trata de paciente femenina, quien acude por imposibilidad para caminar, en silla de rueda, con antecedente de caída de su propia altura, al examen físico, paciente en actitud antalgica en silla de rueda, con fuerte dolor a la extención de cadera izquierda, Lasègue francamente postivo, imposibilidad para acostarse de cubito supino. Con dolor a la digitopresión de L5S1.\r\nSe solicitan estudios radilógicos que revelan fractura de la rama iliopubica izquierda, disminución importante del agujero de comjución de L5S1. Artosis de ambas caderas. Se cumple bloqueo radicular lumbar. Se indica tratamiento medico, reposo absoluto en cama por 40 días y tratamiento fisiátrico. \r\nDx:\r\nLUMBOCIATALGIA SEVERA BILATERAL\r\nFRACTURA DE RAMA ILIOPUBICA IZQUIERDA\r\nSINDROME DE COMPRESIÓN RADICULAR L5S1\r\nARTROSIS DE AMBAS CADERAS\r\n', '2022-11-08 00:00:00', NULL, NULL),
	(27, 169, 1, 'INFORME MÉDICO', 'Se trata de escolar femenina quien posterior a hecho vial, arrollamiento, presenta dolor de larga data en ambos hemitorax, que no alivian con el tratamiento medico. Al examen fisico, dolor intercostal derecho en los arcos 7,8,9 y 10, y dolor intercostal izquierdo y crepitación entre los arcos costales 6,7 y 8, Se realiza bloqueo intercostal bilateral, Se ajusta tratamiento medico.\r\nDx. \r\nNEURITIS INTERCOSTAL BILATERAL\r\nFRACTURA COSTAL IZQUIERDA CONSOLIDADA.', '2022-07-09 00:00:00', NULL, NULL),
	(28, 174, 1, 'INFORME MÉDICO', '.', '2022-09-28 00:00:00', NULL, NULL),
	(29, 188, 1, 'INFORME MÉDICO', 'Se trata de paciente maculino, natural de san cristobal y procedente de la localidad, quien se desempeña como comerciante, que consulta por presentar dolor intenso en ambas rodillas, que le imposibilita deambular. Al examen físico se encuentra rodilla con deformidad severa en valgo, con imposibilidad, para la flexión y en rotación externa. Estudios radiológicos revelan artrosis severa de ambas rodillas, con importsnte pinzamiento articular. Se cumple PRP en ambas rodillas, programada por 5 dosis.\r\nAmerita tratamiento quirúrgico. Artroplasrtia total de ambas rodillas.\r\nDx:\r\nGENUVALGO ARTROSICO BILATERAL:  ', '2022-12-10 00:00:00', NULL, NULL),
	(30, 191, 1, 'INFORME MÉDICO', 'Se trata de paciente femenina, quien consulta por presentar dolor intenso en rodilla izquierda de tres días de evolución, al examen fisico, edema moderado, con raspado rotuliano doloroso, imposibilidad para la flexión completa de la rodilla. Se solicitan estudio radiológicos que revela artrosis lateral severa de rodilla derecha, con genu valgo de20º, ambas rodilla lateralizadas severamente.\r\nSe pograma viscosuplementaión en 3 dosis, hoy se cumple la primera, la segunda para 07.11.22 y la tercera para el 28.11.22.\r\nDx\r\nGENUVALGO ARTROSICO BILATERAL A PREDOMINIO DERECHO\r\nCONDROMALACIA ROTULIANA GRADO 3 BILATERAL\r\nHIDRARTROS DE RODILLA IZQUIERDA. ', '2022-10-17 00:00:00', NULL, NULL),
	(31, 177, 2, 'INFORME MÉDICO', 'Se trata de paciente masculino de 36 años de edad, quien cursa con dolor intenso de aparición súbita, en región lumbar, que se irradia a ambos miembros inferiores, muslo izquierdo y región glútea derecha. Que no alivia con analgésicos comunes. Por lo que acude a está consulta, con marcha antalgica. Al examen físico: Fascie álgida, paciente en actitud de semiflexión, columna que duele al movimiento de extensión.  Imposibilidad para la deambulación por sus propios medios. Digitopresión dolorosa en área lumbar L3 a S1, Lasègue positivo a los 15º. ROT conservados. Parestesias en muslo izquierdo más en relación a muslo derecho, tipo hipersensibilidad. Parestesias dadas por disminución de la sensibilidad en pie izquierdo. En vista de la intensidad  del dolor se realiza bloqueo radicular lumbar, Y se indica tratamiento médico prolongado con pregabalina, analgésicos, relajantes musculares, crema analgésica, protector gástrico y vitamina B. Concomitantemente infección urinaria. Por lo que se indican antibioticos.    \r\nDx: \r\n1.	LUMBOCIATALGIA SEVERA DE EAP \r\n2.	SINDROME DE COMPRESIÓN RADICULAR LUMBAR L3L4, L4L5, L5S1\r\n3. INFECCIÓN URINARIA\r\n', '2022-10-26 00:00:00', NULL, NULL),
	(32, 174, 2, 'INFORME MÉDICO', '.', '2022-10-26 00:00:00', NULL, NULL),
	(33, 198, 1, 'INFORME MÉDICO', 'Se valora paciente masculino de 59 años de edad, natural de San Juan de los Morros y procedente de Caucagua, que acude a consulta para evaluación de estado actual de fractura de cara de 1989 que ameritó reconstrucción facial, con reducción cruenta de fractura etmoidal y del septum nasal anterior y posterior y fractura de antebrazo del 01.01.2018, con reducción cruenta y osteosíntesis con placa de reconstrucción de radio y cubito derecho.  Actualmente al examen físico de cara, no evidencio alteraciones físicas asociadas a dicha lesión con rango de movimiento completo del globo ocular bilateral, simétrico y sin resaltos. No hay dolores ni tumoraciones a la palpación.  En antebrazo derecho, rango de movilidad, conservado y completo, fuerza conservada y neurológicamente sin alteraciones. Se palpa, material de osteosíntesis, sin dolor o crepitación. Se realizan estudios radiológicos de cara y antebrazo. Proyección de frente de cara revela estructuras asociadas a traumatismo consolidadas, tabique nasal recto, senos paranasales limpios. Proyecciones de frente y perfil de cubito y radio derecho, revelan material de síntesis en ambos huesos, con signos de consolidación en ambos huesos, dados por la presencia de continuidad en ambas corticales en ambos huesos. En Radio se evidencia fatiga de material de síntesis, en dos fragmentos, pero sin signos de aflojamiento y que no afectaron la consolidación ósea. Ni ameritan extracción de los mismos. \r\nNota. En mi evaluación clínico radiológico, considero que ambas lesiones están consolidadas, y no hay alteraciones en el eje y la función de los huesos afectados. \r\nDx.\r\nFRACTURA ETMOIDAL CONSOLIDADA\r\nFRACTURA DE SEPTUM ANTERIOR Y POSTERIOR CONSOLIDADA\r\nFRACTURA DE CUBITO Y RADIO DERECHO CONSOLIDADAS\r\nFATIGA DE MATERIAL DE OSTEOSISNTESIS DE RADIO DERECHO SIN SIGNOS DE AFLOJAMIENTO O DE OSTEITIS.  \r\n', '2022-10-26 00:00:00', NULL, NULL),
	(34, 66, 2, 'INFORME MÉDICO', 'Se trata de escolar femenina de 7 años de edad, conocida desde 2014, por acortamiento de miembro inferior derecho como secuela de artritis septica operada a los 17 días de edad, con múltiples cirugias para limpieza quirúrgica, lo cual devino en un cierre del cartilago de crecimiento con un pogresivo aumento de la diferencia en la dismetria a expensas del fémur, hasta que en 2020 alcanzo los 9 cms, por lo que se decidio adelantar cirugía de alargamiento óseo con clavo endomedular y distractor tipo Wagner, logrando recuperar 9 cms. Pero a medida  que ha ido creciendo la otra pierna ha ido nuevamente marcandose una notoria diferencia en la dismetria de losmiembro inferiores con diferencia de 5 cms a expensa de fémur derecho. Por lo que amerita nueva cirugia de alargamiento. \r\nDx\r\nSECUELAS DE ARTRITIS SEPTICA DE RODILLA DERECHA\r\nDISMETRIA DE MIEMBROS INFERIORES A EXPENSAS DE FÉMUR DERECHO.', '2022-10-31 00:00:00', NULL, NULL),
	(35, 73, 5, 'INFORME MÉDICO', 'Se trata de paciente masculino de 88 años de edad, quien posterior a ACV hace 3 meses con caída de su propia altura, presenta fractura de meseta tibial externa, consolidada, con muy poco hundimiento y ruptura de ligamento colateral externo, conocido desde hace 8 años, por genuvaro artrosico. Que amerita tratamiento quirúrgico, artroplastia total de rodilla derecha, ya que el dolor y la deformidad se han hecho intolerables. Por lo que se requiere valoración preoperatoria, por cardiología y neurología', '2022-09-11 00:00:00', NULL, NULL),
	(36, 215, 1, 'INFORME MÉDICO', 'Se trata de paciente femenina de 95 años de edad, quien cursa con fractura de subcapital de femur izquierdo, posterior a caída de su propia altura, al perder el equilibrio. Al Examen físico, paciente con acortamiento, rotación interna y semiflexion de pierna izquierda. Por lo que amerita tratamiento quirúrgico artroplastia de cadera izquierda con protesis tipo thompson. \r\nAmerita valoración cardiovascular, valoracion por medicina interna (Dr. Aparicio). Se refiere para hospitalización.  ', '2022-09-11 00:00:00', NULL, NULL),
	(37, 174, 3, 'INFORME MÉDICO', '.', '2022-07-12 00:00:00', NULL, NULL),
	(38, 235, 2, 'INFORME MÉDICO', 'Se trata de paciente femenina, quien cursa con dolor intenso en hemitorax derecho, con crepitación y limitación funcional, estudios radiológicos revelan fractura de 7 arco costal derecho y aplastamiento de vertebra toracica, T3 y T10, con neuritis intercostal izquierda, con imagerene hiperecoicas en todo el hemitorax, por lo que amerita tratamento medico y reposo, y el uso de silla de ruedas.  \r\nRx de pelvis no revela lesiones. \r\nDx\r\nNEURITIS INTERCOSTAL IZQUIERDA\r\nFACTURA DE 7 ARCO COSTAL IZQUIERDO\r\nFRACTURA POR APLASTAMIENTO DE T3 y T10\r\nLOES MÜLTIPLES EN ARCOS COSTALES DE EAP. ', '2022-12-28 00:00:00', NULL, NULL),
	(39, 84, 2, 'INFORME MÉDICO', 'Se trata de preescolar masculino quien consulta por dolor en los pies de aparición nocturna, que alivia con analgesicos comunes. Al examen fisico, talo valgo bilateral a predominio derecho, con falta de arco plantar. \r\nSe indica tratamiento ortoepdico\r\nDx Pie plano valgo bilateral. ', '2023-01-02 00:00:00', NULL, NULL),
	(40, 44, 4, 'INFORME MÉDICO', 'Se trata de paciente masculino quien cursa con dolor edema y limitación funcional de rodilla izquierda, sin antecedente traumático, al examen físico actual, se encuentra paciente, con marcha normal, sin edema de rodilla izquierda, con signo del tempano negativo, raspado rotuliano positivo, flexión dolorosa, apley positivo medial. Se cumple viscosuplementación de rodilla izquierda. Se ajusta tratamiento médico.\r\nPendiente cumplir Acido Hialuronico.\r\nDx.\r\nCONDROMALACIA ROTULIANA BILATERAL A PREDOMINIO IZQUIERDO\r\nHIDRARTROSIS RESUELTA\r\nGENUVARO ARTROSICO\r\nLUMBOCIATALGIA DE EAP. EN RESOLUCIÓN ', '2023-01-02 00:00:00', NULL, NULL),
	(41, 46, 10, 'INFORME MÉDICO', 'Se trata de pciente femenina, conocida de hace mas de 10 años, natural del Castillo (Km 38) estado Zulia y procedente del Caracolí edo Zulia, quien cursa con dolor cervical, dolor lumbar y secreción purulenta en ambospies. Por discoartrosis generalizada, con sindrome de compresión radicular C6C7 y L4L5. Con osteomielits activa de mbos calcaneos, por lo se encuentra incapacitada para realizar sus actividades cotidianas, ameritamdo asistencia familiar permanente. ', '2023-02-22 00:00:00', NULL, NULL),
	(42, 280, 1, 'INFORME MÉDICO', 'Se trata de paciente femenina quien cursa con dolor en hombro derecho de tres meses de evolución que no alivia con el tratamiento médico. Al examen físico, limitación funcional a todos los rangos de movimientos del hombro, con dolor que se irradia a cuello, cara antero lateral de brazo y omoplato ipsilateral, dolor a la digitopresión en área sub acromial anterior y posterior. Se cumple infiltración dorsal de hombro y solicito ultrasonido del mismo.\r\nDx\r\nHOMBRO DOLOROROSO DERECHO\r\nHIOMBRO CONGELADO DERECHO\r\nCAPSULITIS ADHESIVA DE HOMBRO DERECHO\r\n', '2023-03-15 00:00:00', NULL, NULL),
	(43, 283, 1, 'INFORME MÉDICO', '.', '2023-08-08 00:00:00', NULL, NULL);
