	(2, 2, 1, 978, 'FEMENINA, quien consulta posterior a HECHO VIAL, por presentar los Dxs de: \r\nESGUINCE DE RODILLA DERECHA, FRACTURA CON LESION OSTEOCONDRAL EN MESETA TIBIAL EXTERNA, RUPTURA DEL CUERPO Y CUERNO POSTERIOR DE MENISCO EXTERNO, DERRAME ARTICULAR. Con mejoría del dolor, pero persistencia de marcha claudicante con dolor e imposibilidad para la flexión, por escalón posterior de meseta tibial externa.. Amerita fortalecimiento del cuadriceps femoral.  Agradezco valoración y condutcta. ', NULL, NULL),
	(3, 22, 2, 979, 'Femenina, conocida desde febrero de 2010 por cervicobraquialgia, lumbociatalgia severa, contractura paravertebral toracolumbar derecha, neuritis intercostal derecha (Resuelta), canal estrecho foraminal L5S1 bilateral, radiculopatia L5 derecha, estrechez de receso S1 izquierdo, espondiloartrosis lumbar, escoliosis del adulto, con sintomatología compresiva radicular severa, que no ha mejorado a pesar de tratamieto medico, fisiatrico y bloqueos, en el trasncurso del tiempo. Por lo que se mantiene reposo, se solicita valoración por psiquiatria, ', NULL, NULL),
	(4, 41, 1, 978, 'Se trata de paciente masculino quien cursa con postoperatorio tardio de fractura de meseta tibial derecha y ruptura del cruzado anterior, hace 15 años aproximadamente, actualmente con tumoración dolorosa, con parestesias en cara medial y proximal de pierna afecta. Que no es visible radiológicamente, por lo que agradezco realizar ultrasonido. ', NULL, NULL),
	(5, 5, 5, 978, 'Se trata de paciente masculino, quien presento elongación del ligamento colateral medial de rodilla izquierda, se aplico PRP, con mejoria del bostezo. Amerita fortalecimiento del la musculatura de la rodilla, por lo que agradezco valoración y conducta.', NULL, NULL),
	(6, 51, 1, 978, 'Se trata de paciente masculino con dolor en cara ventral de codo izquierdo, inserción de biceps braquial y en cara ventral de muñeca izquierda, por lesion traumatica, sobre tendones flexores, agradezclizar ultrasonido. ', NULL, NULL),
	(7, 17, 2, 980, 'Se trata de escolar femenina, quien cursa con comdromalacia rotuliana, por mal alineación rotuliana, actualmente en fase aguda de dolor. por lo que amerita fortalecimiento del cuadriceps femoral, Agradezco valoración y conducta. ', NULL, NULL),
	(8, 60, 1, 978, 'Femenina con tumoración en cara lateral izquierda de cuello, libre, movil y blanda. No dolorosa, agradezco realizar ultrasonido de cuello, para evaluar realicion con estrcturas profundas. ', NULL, NULL),
	(9, 11, 5, 978, 'Se trata de paciente femenina con espondilolistesis L4L5 y L5S1, con sindorme de compresión radicular Multisgmentaria, a quien se ha cumplido esquema de bloqueo radicular.Con sarcopenia y osteopenia. Amerita tratamiento fisiátrico, para fortalecimeineto de la musculatura de la espalda, iniciar de forma progresiva, para no reactiavr el dolor.  Por lo que agradezco valoración y conducta. ', NULL, NULL),
	(10, 37, 1, 978, 'LUXOFRACTURA DE CODO IZQUIERDO. Se trata de ecolar femenina de 6 años, con fractura consolidada, Con dificultad para la flexión a 85ª. fractura totalmente consolidada. Amerita insistir tratamiento fisiátrico para mejora la flexión. Articulaión totalmente libre. ', NULL, NULL),
	(11, 73, 1, 978, 'Se trata de paciente masculino de 87 años, con Genu varo artrosico bilateral, y sarcopenia importante, que amerita fortalecimiento de nusculatura de rodilla y cuadriceps femoral por lo que agradezco valoracuón y conducta.  ', NULL, NULL),
	(12, 83, 1, 981, 'Femenina con cervicalgia, que se irradia a mandibula y oidos, pero con dolor al tragar, Valorado por otorrino y gastroenterologo sin mejoria. Agradezco valoración y conducta. ', NULL, NULL),
	(13, 31, 2, 978, 'Se trata de paciente femenina, quien cursa con lumbociatalgia a causa de ESPONDILODISCOPATIA MULTISEGMENTARIA.\r\nEXTRUSION CENTRAL Y SUBLIGAMENTARIA L4-L5 OUE SE ASOCIA A HIPERTROFIA FACETARIA Y\r\nLIGAMENTOS AMARILLOS CONDICIONANDO EL CANAL ESTRECHO.\r\nABOMBAMIENTO DEL DISCO L5S1 QUE REDUCE PARCIALMENTE AMBOS FORAMENES NEURALES. AMERITA FORTALECIMIENTO DE LA MUSCULATURA DE LA ESPALDA, POR LO QUE AGRADEZCO VALORACIÓN Y CONDUCTA. ', NULL, NULL),
	(14, 102, 1, 978, 'Se trata lactante menor , con antecedente de alto riego neurológico, por crisis convulsiva neonatal. (SDR) y con hipotonia generalizada. Amerita valoración y conducta. Agradezco informe. ', NULL, NULL),
	(15, 123, 1, 978, 'Se trata de lactante mayor de 17 meses de edad, quien presenta PCI espástica con hemiparesia izquierda, que amerita tratamiento fisiátrico y control, por lo que agradezco valoración y conducta.  \r\nAgradeciendo tu atención\r\n', NULL, NULL),
	(16, 130, 1, 978, 'Femenina con lesión clinica de menisco medial, cuerno posterior de rodilla izquierda, se cumplio viscosuplementación con flextril, 4 dosis, con mejoria cercana al 90%, amerita tratamiento fisiátrico, por lo que agradezco valoración y conducta. (24.08.22)', NULL, NULL),
	(17, 137, 1, 978, 'Se trata de paciente femenina con Alzahimer y rigidez de caderas, sacroiliaca y rodillas, que amerita tratamiento fisiátrico de estiramiento y fortalecimiento. Por lo que agradezco valoración y conducta. ', NULL, NULL),
	(18, 140, 1, 985, 'Se trata de paciente masculino de 55 años de edad, quien cursa con tendinitis insercional del aquiles, pero con deformidad importante, por lo que agradezco realizar ultrasonido. ', NULL, NULL),
	(19, 154, 1, 985, 'Se trata de paciente masculino con desgarro de gemelos izquierdo, amerito precisar profundidad y longitud de la lesión, igualmente agradezco realizar ultrasonido de ambos hombros por lesión del manguito rotador derecho (supraespinoso y biceps braquial) y hombro izquierdo infraespinosa. ', NULL, NULL),
	(20, 100, 4, 985, 'Se trata de paciente masculino con dolor en cara anterior de hombro, que afecta porcion larga del biceps y bursa subacromial, agradezco realizar ultrasonido de hombro ', NULL, NULL),
	(21, 100, 5, 978, 'Se trata de paciente masculino quien cursa con hombro doloroso, que no responde a tratamiento con ultrasonido que revela \r\nLESION DIFUSA IMPORTANTE DEL TENDON LARGO DEL BICEPS,\r\nLESIÓN DIFUSA INFLAMATORIA INTRASUSTANCIA DEL TENDON DEL SUPRAESPINOSO, SUB\r\nESCAPULAR Y PORCIÓN LARGA DEL BÍCEPS\r\nCONTRACTURA MUSCULAR SOSTENIDA DE LOS MUSCULOS TRAPECIO, INFRAESPINOSO\r\nSUPRAESPINOSO Y SUBESCAPULAR\r\nCALCIFICACIONES DIFUSAS Y AGRUPADAS EN COMPONENTES BLANDOS DEL MANGUITO ROTADOR\r\nPINZAMEINTO GRADO II ECOGRAFICO CON\r\nESPACIO INTRARTICULAR DISMINUIDO\r\nAgradezco valoración y conducta', NULL, NULL),
	(22, 61, 1, 978, 'Paciente con dolor de hombro derecho, conocida por cervicobraquialgia, rotación interna y abducción dolrosa, agradezco realizar ultrasonido', NULL, NULL),
	(23, 76, 1, 978, 'Femenina con dolor en hombro derecho a la abducción forzada,. Agradezco ultrasonido de hombro.', NULL, NULL),
	(24, 78, 1, 978, 'Agradezco ultrasonido de hombro derecho.', NULL, NULL),
	(25, 82, 1, 982, 'Saludos mi dilecto amigo. Te refiero paciente masculino, portador de HEMOFILIA, quien consulta por presentar dolor en hombro izquierdo, solicito estudio radiológico, que revela malformación de la cabeza humeral. Por lo que agradezco valoración y conducta.  ', NULL, NULL),
	(26, 9, 4, 978, 'Femenina con dolor mecanico por espondilolistesis grado I desde L3L4, L4L5 y L5S1, amerita fortalecimiento de columna. Agradezco Valoración y conducta. ', NULL, NULL),
	(27, 46, 2, 983, 'Femenina con dolor intenso, ardor y parestesias en pie izquierdo, sin antecedente trumático. Agradezco realizar EMG de miembro inferior izquierdo. ', NULL, NULL),
	(28, 115, 2, 985, 'Se trata de paciente femenina, con dolor de hombro derecho, que no responde al tratamiento, agradezco realizar ultrasonido de hombro. ', NULL, NULL),
	(29, 143, 1, 980, 'Se trata de paciente femenina quien cursa con escoliosis toraco lumbar y condromalacia rotuliana, Por lo que amerta fortalecimiento de la musculatura de la espaalda. Por lo que agradezco valoración y conducta. ', NULL, NULL),
	(30, 144, 1, 985, 'Se trata de paciente masculino quien cursa con hombro doloroso, probable afectación del supraespinosos, biceps braquial e infraespinoso (este ultimo duele más), agradezco realizar ultrasonido.', NULL, NULL),
	(31, 110, 5, 983, 'Parestesias de ambos miembros superiores, agradezco realizar EMG de ambos miembrossuperiores. ', NULL, NULL),
	(32, 113, 3, 982, 'Saludos amigo, te refiero paciente masulino quien cursa con pinzamiento del manguito rotador, con ruptura del tendon del supraespinoso, por lo que agradezco tu valoración y conducta ', NULL, NULL),
	(33, 113, 2, 986, 'Saludos, te refiero paciente masulino quien cursa con pinzamiento del manguito rotador, con ruptura del tendon del supraespinoso, por lo que agradezco tu valoración y conducta ', NULL, NULL),
	(34, 16, 2, 983, 'CERVICOBRAQUIALGIA. Femenina con parestesias de ambos miembros superiores a predominio del izquierdo, que afecta dedo pulgar,indice y anular, Por lo que agradezco realizar EMG de ambos miembros superiores', NULL, NULL),
	(35, 103, 3, 985, 'Femenina quien cursa con dolor en talon izquierdo, posterior a infiltración por fascitis plantar y espolon calcaneo. agradezco realizar ultrasonido. ', NULL, NULL),
	(36, 114, 6, 978, 'Se trata de paciente femenina, con postoperatorio tardio, comlicado de artrsocopia de rodilla derecha, con posible sindromede sudek de rodilla. Con mejoria desde el punto de vista del dolor.Pero con mucha rigidez. Por lo que amerita tratamiento fisiátrico progresivo y suave. Agradezco Valoración y conducta. ', NULL, NULL),
	(37, 184, 1, 983, 'Femenina con dolor en manos, dedo indice, medio y anular,  con tinnel positivo. Agradezco realizar electromiografia de ambos miembros superiores.', NULL, NULL),
	(38, 176, 2, 980, NULL, NULL, NULL),
	(39, 196, 1, 983, 'Femenina con lesion postraumatica de ciaticopopliteo externo, por fractura por avulsion de cabeza de perone y ruptura del ligamento colateral lateral.. Agradezco electromiografia de miembro inferior izquierdo. ', NULL, NULL),
	(40, 196, 2, 978, 'Se trata de paciente femenina, quien cursa con  axonotmesis oarcial de ciatico popliteo externo, con ruptura de ligamento colateral lateral, con fractura de la cabeza del perone, Por lo que amerita tratamento fisiátrico, agradezco valoración y conducta', NULL, NULL),
	(41, 200, 1, 985, 'Masculino con crepiatción posttraumatico en cara anterior de codo derecho, Por lo que agradezco realizar ultrasonido .', NULL, NULL),
	(42, 205, 1, 984, 'Se trata de paciente masculino, hipotrofia importante de gemelos y disminución de la fuerza de hallux derecho, de dos meses de evolucón. Agradezco realizar EMG de miembro inferios derecho. ', NULL, NULL),
	(43, 199, 2, 985, 'Femenina con hombro doloroso derecho, que en Rx impresiona subluxación del mismo, pero que no se correlaciona con rangos de movimientos, por lo que agradezco realizar utrasonido de hombro derecho. ', NULL, NULL),
	(44, 73, 5, 978, NULL, NULL, NULL),
	(45, 214, 1, 985, 'Masculino, quien el 06.11.22, sufre accidente con becerro, posterior al cual presenta hematoma importante, con signo del hacha en cara dorsal de muslo derecho, por desgarro, agradezco realizar ultrasonido. ', NULL, NULL),
	(46, 176, 3, 987, 'Se trata de paciente femenina, con escoliosis toracolumbar, que amerita fortalecimiento de la musculatura de la espalda, de formaprogresiva, sin peso muerto. Agradezco valoración y conducta, ', NULL, NULL),
	(47, 222, 1, 988, 'Se trata de paciente femenina con epondilodiscopatia multisegmentaria, con abombamiento discal L4L5 y L5S!, con compromiso foraminal bilateral y del canal raquideo, con deficit neurologico a predominio derecho. Agradezco valoración y conducta. ', NULL, NULL),
	(48, 165, 2, 983, 'Se trata de femenina con cervicalgia y dolor en meñique dereche, con antecedente de neuralgia por herpes, agradezco realizar electromiografia de miembro superior derecho. ', NULL, NULL),
	(49, 229, 1, 985, 'Se trata de paciente masculino, con dolor y limitación funcional de hombro izquierdo, posterior a traumatismo directo en varias oportunidades, sobre el mismo, agradezco valoración y conducta. ', NULL, NULL),
	(50, 205, 3, 978, 'Se trata de paciente masculino con lesión lumbar dada por espondiloliscopatia L4L5 con extrusión central y posterolateral derecha, con mioatrofia de gemelos y cuadriceps femoral, agradezco terapia para fortalecimiento de musculatura de la espalda y gemelos derechos. ', NULL, NULL),
	(51, 150, 4, 978, 'Se trata de paciente femenina, quien cursa con lumbociatalgia de larga data, por sindrome compresión radicular L4L5 y L5S1, con mioatrofia musculra. Amerita fortalecimiento de musculatura de la espalda y miembros inferiores, por lo que agradezco valoración y conducta.', NULL, NULL),
	(52, 197, 2, 987, 'Se trata de paciente femenina con condromalacia rotuliana, hipotrofia de cuadriceps femoral, que amerita fortalecimiento del mismo. agradezco valoración y conducta. ', NULL, NULL),
	(53, 223, 3, 985, 'Se trata de paciente femenina, quien cursa con dolor en cara anterior, tercio distal de tibia izquierda, con edema en cara anterior de tobillo, en área de extensor del hallux, por lo que agradezco realizar ultrasonido. ', NULL, NULL),
	(54, 122, 2, 978, 'Femenina con sindrome del hombro dolororoso, e inflamación de l porcion larga del biceps, por lo que agradezco realizar ultrasonido. ', NULL, NULL),
	(55, 229, 4, 983, 'Se trata de paciente con dolor en hombro izquierdo, con importante limitación a la moviliad, que habia mejorado en un 60 % con tratamiento medico, pero que en la última semana posterior a infiltración sin esteroides, nuevamente presenta limitción funcional y ahora con perdida de fuerza, por lo que agradezco realizar EMG de miembro superior izquierdo y valoració con conducta fisiátrica. ', NULL, NULL),
	(56, 252, 1, 980, 'Se trata de paciente femenina con escoliosis descompensada, toracolumbar, que amerita fortalecimiento de la musculatura de la espalda. por lo que agradezco valoración y conducta.', NULL, NULL),
	(57, 261, 1, 983, 'Masculino quien cursa con parestesias de pulgar, medio y anular, de varios días de evolución, agrdaezco realizar EMG de miembro superior derecho', NULL, NULL),
	(58, 225, 4, 979, 'Se trata de paciente femenina, quien cursa con fibromialgia, artritis de EAP, apofisitis toracica, túnel del carpo derecho, hombro doloroso derecho, con cuadros de "ansiedad" que se manifiestan con miembro superior izquierdo "dormido", cara esta dormida, temblor de manos. Hormigueo en cuero cabelludi. Se cumple bloqueo torácico, intercostal. Se indica sertralina. Toma alprazolan 1 mgs, desde hace más de un año, sin efecto. Agradezco valoración y conducta.', NULL, NULL),
	(59, 52, 2, 983, 'Femenina que refiere parestesias cotidiana de mano derecha, asociada con cambios de coloración. Agradezco realizar EMG de miembro superior derecho.', NULL, NULL),
	(60, 276, 1, 983, 'Se trata de paciente femenina quien cursa con calambres y parestesias en indice, medio y anular de mano derecha, con tinnel positivo, por lo que agradezco realizar EMG de miembro superior derecho. ', NULL, NULL),
	(61, 280, 1, 978, 'Femenina con dolor de hombro derecho de larga data, con importante limitación funcional, agradezco realizar USG de hombro. ', NULL, NULL),
	(62, 251, 4, 978, NULL, NULL, NULL);
